INSERT INTO `places` VALUES ('02d9a2b5-7dca-423f-8406-707bc76abf7e','2017-03-25 02:17:06','2017-03-25 02:17:06','1721b75c-e0b2-46ae-8dd2-f86b62fb46e6','3ea61b06-e22a-459b-bb96-d900fb8f843a','The Lynn House','Our place is 2 blocks from Vista Park (Farmer\'s Market), Historic Warren Ballpark, and about 2 miles from Old Bisbee where there is shopping, dining, and site seeing. We offer continental breakfast. You get the quiet life with great mountain and garden views. This is a 100+ year old cozy home which has been on both the Garden and Home tours. You have access to whole house, except for 1 restricted area (She-Shack).  Hosts are on site in a casita in the back from 8pm until 7am when we are in town.<BR /><BR />Our home has two bedrooms, one king and one queen.  There are 2 bathrooms, 1  1950\'s soak tub with shower and 1 with shower only.  Guests have access to the living/dining room area, and the kitchen (except for use of stove/oven).  Each morning, coffee/tea, and muffins are ready for guests.  A small frig is available in the dining room with water/juice and an area for guest items.  1 parking space is directly across the street.  There is a large back patio with a grill for guests to u',2,2,4,82,31.4141,-109.879),('0675a2d6-f64c-4be7-9a8a-f55341f09d4b','2017-03-25 02:17:06','2017-03-25 02:17:06','4a0c57bb-60da-450c-afcf-c59be4c05e67','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Cozy, Bright Studio in GOLD COAST w/Rooftop','This lovely, sunny studio is in the beautiful Gold Coast neighborhood of downtown Chicago. Bars, restaurants, parks, shopping and public transport are within walking distance. Steps away from the Loop. Prime nearby attractions include Lake Michigan, Oak Street Beach, Lincoln Park, Museum of Contemporary Art and the Lyric Opera. Rush Street, which offers great dinning, shopping and entertainment, is a short block away.<BR /><BR />Apartment has shared rooftop with beautiful views of Chicago\'s skyline.<BR /><BR />This 250 sq. ft. studio is cozy, warm, and with lots of light. The small kitchen has a stove, a microwave, a toaster, and an espresso machine loaded with good coffee. Our apartment has a queen-sized mattress, and two-person sofa: altogether they can accommodate three persons. Plenty of closet space.<BR /><BR />You will have an access to a shared rooftop, and a laundry room. Free street parking is available very close to the building on LaSalle Street (except 4PM - 6:30 PM on week',0,1,2,65,41.9009,-87.6298),('073084e1-1d9d-49e6-8383-42ef6f4325b5','2017-03-25 02:17:06','2017-03-25 02:17:06','f3923bdf-81f2-45e9-a5e1-fd128e122d45','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Fairpark. Downtown Tupelo','A private bedroom with a queen size bed and private bathroom is available in my 3 bedroom home in Tupelo\'s Downtown Fairpark. Access to Living area, laundry and kitchen included. One block from downtown shopping, restaurants, BancorpSouth Arena and the Farmer\'s Market. This is a friendly and quiet neighborhood. There are 2 bedrooms available for up to 4 guests.<BR /><BR />Parking is available at house. One block from downtown tupelo, Lots of restaurants, shopping and entertainment within 1 block of house.',1,1,2,54,34.2546,-88.7022),('09b4888f-0e06-4ab1-abbc-05e9865634d0','2017-03-25 02:17:06','2017-03-25 02:17:06','e4e40a6e-59ff-4b4f-ab72-d6d100201588','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Spanish Town Historic District, Heart of Downtown','Our home is a block away from parks, art and culture, including several museums and the Capitol district,  and restaurants and bars within walking distance. Very safe, quiet, in the bustle of downtown but the privacy of a neighborhood. The location, the people, and the ambiance of our funky neighborhood, Spanish Town, make this a perfect spot when visiting. My place is perfect for couples, solo adventurers, business travelers, and pets.',1,1,2,65,30.4557,-91.1827),('0a454f9a-eaac-488b-8443-23cf58f7ae37','2017-03-25 02:17:06','2017-03-25 02:17:06','5e061866-d4ad-4aa7-be